import './App.css';
import Details from './photoes/Details';
import Photo from './photoes/photo';
import {  Routes, Route } from "react-router-dom";

function App() {

  return (
    <Routes>
    <Route path='/' Component={Photo}/>
    <Route path='/detail:id' Component={<Details/>}/>
    </Routes>
  );
}

export default App;
